    <div>
        <h1>SV-Garage</h1>
        <div><button>New costumer</button></div>
        <div>
            <select></select>
        </div>
        <div>
            <input type='radio' name='id' value='id' onChange={(e) => {setId(e.target.value)}}/>id
            <input type='radio' name='plateNumber' value='plateNumber' onChange={(e) => {setPlateNumbers(e.target.value)}}/>plate number
        </div>
    </div>
  )
}
